button{display:block;text-align:center;}

#header_middle_grain

	/*margin-left: auto;
	margin-right: auto;*/
	margin:0 auto;
	padding-left: 60px;
	padding-top: 6px;
	width: 80%;

#field_area
{
	position: relative;
	margin-left: auto;
	margin-right: auto;
	width: 968px;
	height: 726px;
	background: url('images/field_background.jpg');
}
#field_area div
{
	position: absolute;
	display: none;
	left: 0px;
	top: 0px;
	border-radius: 20px;
	width: 40px;
	height: 40px;
	background-color: #C0DFEF;
	color: #303080;
	line-height: 40px;
	text-align: center;
	font-weight: bold;
}
#field
{
	margin-left: 23px;
	margin-top: 44px;
	width: 922px;
	height: 632px;
}
#footer_middle_text
{
	margin-left: auto;
	margin-right: auto;
	width: 1010px;
	height: 86px;
	background: url('images/footer_middle_text.jpg');
}
#progress{margin-bottom:6px;}
</style>
<script>
$(function()
{

var demo = {};
demo.scope = { x: 1, y: 1 };
demo.scale = { x: 1, y: 1 };
demo.data = { a: [], b: [] };
demo.title = '';
demo.player = '';
demo.previousCursor = { a: 0, b: 0 };
demo.cursor = { a: 0, b: 0 };
demo.action = null;
demo.running = false;
demo.stopping = false;
demo.pause = false;
demo.isOpen = true;
demo.clickNum = 0;
demo.sumTime = {a: 0,b: 0};
demo.getASumTime = null;
demo.getBSumTime = null;
demo.value = 0;
demo.interval = null;
demo.htmlCanvasContext = null;

demo.progress = function()
{
	var progress = document.getElementById("progress");
	var sumtime = demo.compare();
	sumtime = sumtime/100;
	demo.interval = setInterval(demo.intervalfunc,sumtime/1.5)
}

demo.intervalfunc = function(){
	if(demo.value++ >= progress.max){
		clearInterval(demo.interval);
		demo.value=progress.value=0;
	}
	progress.value = demo.value;
}

/**
 * 如果'a'和'b'这两段文本数据不是同时开始
 * 获取'a'和'b'的总时间段，并比较最大值，取最大时间。
 */
demo.compare = function()
{
	return Math.max(demo.getASumTime, demo.getBSumTime);
};

/**
 * 获得总的时间间隔
 */
demo.getSumTime = function(player, startLineData, endLineData)
{
	var timeStr = startLineData.substring(0, 19);
	timeStr = timeStr.replace(/\-/ig, '/');
	var time = new Date(timeStr).getTime();
	var timeInMillis = time + parseInt(startLineData.substring(20, 23));
	var timeStr2 = endLineData.substring(0, 19);
	timeStr2 = timeStr2.replace(/\-/ig, '/');
	var time2 = new Date(timeStr2).getTime();
	var timeInMillis2 = time2 + parseInt(endLineData.substring(20, 23));
	return demo.sumTime[player] = Number(timeInMillis2) - Number(timeInMillis);
}
/**
 * 判断给定的一行文本数据，是否是正确的数据。
 */
demo.checkTextLineData = function(textLineData)
{
	if (!textLineData)
	{
		return false;
	}
	try
	{
		var position = demo.fetchPositionFromTextLineData(textLineData);
		if (!position || typeof position != 'object')
		{
			return false;
		}
		else if (position.x === undefined || position.y === undefined)
		{
			return false;
		}
	}
	catch (ex)
	{
		return false;
	}
	return true;
};

/**
 * 加载指定球员的数据。
 * @param	player	string	球员的名称，目前分为 a 和 b 。
 */
demo.loadPlayerData = function(player)
{
	var dataText = $('#player_' + player + '_data').val();
	var dataArr = dataText.split('\n');
	if (dataArr.length <= 1)
	{
		return false;
	}
	if (!demo.checkTextLineData(dataArr[0]))
	{
		demo.title = dataArr.shift();
	}
	if (!demo.checkTextLineData(dataArr[dataArr.length - 1]))
	{
		dataArr.pop();
	}
	if (dataArr.length <= 1)
	{
		return false;
	}
	demo.data[player] = dataArr;
	var startLineData = demo.data[player][0];
	var endLineData = demo.data[player][dataArr.length - 1];
	if (player == 'a')
	{
		demo.getASumTime = demo.getSumTime('a', startLineData, endLineData);
	}else if (player == 'b')
	{
		demo.getBSumTime = demo.getSumTime('b', startLineData, endLineData);
	}
	return true;
};

/**
 * 加载所有可配置数据。
 */
demo.loadData = function()
{
	demo.scope.x = $('#field_width').val();
	demo.scope.x = demo.scope.x ? Number(demo.scope.x) : 8;
	demo.scope.y = $('#field_height').val();
	demo.scope.y = demo.scope.y ? Number(demo.scope.y) : 6;
	demo.scale.x = 922 / demo.scope.x;
	demo.scale.y = 632 / demo.scope.y;
	if (!demo.loadPlayerData('a'))
	{
		console.log('球员甲的数据加载失败');
	}
	if (!demo.loadPlayerData('b'))
	{
		console.log('球员乙的数据加载失败');
	}
};

/**
 * 程序启动时初始化功能对象的配置。
 */
demo.init = function()
{
	var canvasObj = document.getElementById('field');
	demo.htmlCanvasContext = canvasObj.getContext('2d');
	demo.htmlCanvasContext.strokeStyle = 'rgba(47, 177, 207, 0.15)';
	demo.htmlCanvasContext.lineWidth = 10;
	demo.loadData();
};

/**
 * 刷新，以供开始执行某给定函数。
 * @param	fun	function	刷新之后执行的函数
 */
demo.refresh = function()
{
	if (demo.running)
	{
		demo.stopping = true;
		setTimeout(demo.refresh, 100);
		return;
	}

	if (demo.isOpen)
	{
		demo.loadData();
		demo.previousCursor = { a: 0, b: 0 };
		demo.cursor = { a: 0, b: 0 };
		demo.running = true;
		demo.htmlCanvasContext.clearRect(0, 0, 968, 726);
		$('#field_area div').hide();
		$('#player_a').css({ 'left': '0px', 'top': '0px' });
	}
	demo.action.call(this);
};

/**
 * 启动绘制轨迹热点图。
 */
demo.drawHeapMap = function()
{
	demo.htmlCanvasContext.beginPath();
	var position = demo.fetchPosition(demo.player, false);
	demo.htmlCanvasContext.moveTo(position.xPx, position.yPx);
	demo.next(demo.player);
	//var firstDiff = demo.getTimeDiff(demo.player, 30);
	//setTimeout(demo.drawLine, firstDiff);
	demo.drawLine();
};

/**
 * 抽取一行给定文本数据的 x, y 。
 * @param	dataTextLine	string	给定的文本数据
 */
demo.fetchPositionFromTextLineData = function(dataTextLine)
{
	var positionStart = dataTextLine.indexOf('{');
	var positionEnd = dataTextLine.indexOf('}');
	var positionText = dataTextLine.substring(positionStart, positionEnd + 1);
	var position;
	eval('position = ' + positionText);
	if (position.x < 0)
	{
		position.x = 0;
	}
	if (position.x > demo.scope.x)
	{
		position.x = demo.scope.x;
	}
	if (position.y < 0)
	{
		position.y = 0;
	}
	if (position.y > demo.scope.y)
	{
		position.y = demo.scope.y;
	}
	return {
		'x': position.x,
		'y': position.y,
		'xPx': position.x * demo.scale.x,
		'yPx': position.y * demo.scale.y
	};
};

/**
 * 抽取本次或上次数据的 x，y 。
 * @param	isPrevious	boolean	其值为 true 代表上一次，false 代表本次
 */
demo.fetchPosition = function(player, isPrevious)
{
	var cursor = isPrevious ? demo.previousCursor[player] : demo.cursor[player];
	var dataTextLine = demo.data[player][cursor];
	return demo.fetchPositionFromTextLineData(dataTextLine);
};

/**
 * 获取本次或上次数据的时间。
 * @param	isPrevious	boolean	其值为 true 代表上一次，false 代表本次
 */
demo.fetchTime = function(player, isPrevious)
{
	var data = demo.data[player];
	var cursor = isPrevious ? demo.previousCursor[player] : demo.cursor[player];
	var dataTextLine = data[cursor];
	var timeStr = dataTextLine.substring(0, 19);
	timeStr = timeStr.replace(/\-/ig, '/');
	var time = new Date(timeStr).getTime();
	var timeInMillis = time + parseInt(dataTextLine.substring(20, 23));
	return timeInMillis;
};

/**
 * 获得本次和上次的数据的时间间隔
 */
demo.getTimeDiff = function(player, speed)
{
	var prvTime = demo.fetchTime(player, true);
	var thisTime = demo.fetchTime(player, false);
	var timeDiff = thisTime - prvTime;
	return timeDiff / speed;
};

/**
 * 绘制连接到本次数据对应点的直线，并启动延时的下次画线。
 */
demo.drawLine = function()
{
	if (demo.stopping)
	{
		demo.running = false;
		demo.stopping = false;
		return;
	}
	demo.htmlCanvasContext.beginPath();
	var previousPosition = demo.fetchPosition(demo.player, true);
	var thisPosition = demo.fetchPosition(demo.player, false);
	demo.htmlCanvasContext.moveTo(
			previousPosition.xPx, previousPosition.yPx);
	demo.htmlCanvasContext.lineTo(thisPosition.xPx, thisPosition.yPx);
	demo.htmlCanvasContext.stroke();
	var doNextResult = demo.next(demo.player);
	if (!doNextResult)
	{
		demo.running = false;
		return;
	}
	//var timeDiff = demo.getTimeDiff(demo.player, 30);
	//setTimeout(demo.drawLine, timeDiff);
	demo.drawLine();
};

/**
 * 数据是一个一个延时处理的。本方法用于将针对的数据延时间正方向推移一个单位。
 * 因为数据时常有错误，所以本方法还需要负责跳过不正确的数据。
 * @return	如果没有下一个数据了，返回 false ，否则返回 true 。
 */
demo.next = function(player)
{
	demo.previousCursor[player] = demo.cursor[player];
	var position = null;
	do
	{
		var cursor = ++demo.cursor[player];
		if (cursor >= demo.data[player].length - 1)
		{
			return false;
		}
		var textLineData = demo.data[player][cursor];
		if (!demo.checkTextLineData(textLineData))
		{
			continue;
		}
		position = demo.fetchPosition(player, false);
	}
	while (position.x < 0.001 && position.y < 0.001);
	return true;
};

demo.moveDivToPosition = function($div, position)
{
	var radius = 20;
	var left = position.xPx - radius + 23 + 'px';
	var top = position.yPx - radius + 44 + 'px';
	$div.css({ 'left': left, 'top': top });
};

/**
 * 启动一个球员的演示。
 */
demo.replayPlayer = function(player)
{
	var position = demo.fetchPosition(player, false);
	demo.moveDivToPosition($('#player_' + player), position);
	var doNextResult = demo.next(player);
	if (!doNextResult)
	{
		demo.running = false;
		return false;
	}
	var firstDiff = demo.getTimeDiff(player, 1.5);
	setTimeout(demo.movePlayer[player], firstDiff);
	return true;
};

/**
 * 演示比赛过程。
 */
demo.replayMatch = function()
{
	$('#field_area div').show();
	var replayAResult = demo.replayPlayer('a');
	if (!replayAResult)
	{
		console.log('数据错误，无法重现球员甲的行动。');
	}
	var replayBResult = demo.replayPlayer('b');
	if (!replayBResult)
	{
		console.log('数据错误，无法重现球员乙的行动。');
	}
};

demo.movePlayer = {
	a: function()
	{
		demo.moveOnePlayer('a');
	},
	b: function()
	{
		demo.moveOnePlayer('b');
	}
};

demo.moveOnePlayer = function(player)
{
	if (demo.stopping)
	{
		demo.running = false;
		demo.stopping = false;
		return;
	}
	var position = demo.fetchPosition(player, false);
	demo.moveDivToPosition($('#player_' + player), position);
	if (demo.pause)
	{
		demo.running = false;
		//demo.isOpen = false;
		return;
	}
	var doNextResult = demo.next(player);
	if (!doNextResult)
	{
		demo.running = false;
		return;
	}
	var timeDiff = demo.getTimeDiff(player, 1.5);
	setTimeout(demo.movePlayer[player], timeDiff);
};

$('#draw_a_btn').click(function()
{
	clearInterval(demo.interval);
	$('#pause_btn').attr('disabled', false);
	$('#perform_btn').attr('disabled', false);
	demo.isOpen = true;
	demo.player = 'a';
	demo.action = demo.drawHeapMap;
	demo.refresh();
	$('#pause_btn').attr('disabled', true);
});
$('#draw_b_btn').click(function()
{
	clearInterval(demo.interval);
	$('#pause_btn').attr('disabled', false);
	$('#perform_btn').attr('disabled', false);
	demo.isOpen = true;
	demo.value = 0;
	demo.player = 'b';
	demo.action = demo.drawHeapMap;
	demo.refresh();
	$('#pause_btn').attr('disabled', true);
});
$('#perform_btn').click(function()
{
	demo.pause = false;
	demo.isOpen = true;
	demo.value = 0;
	demo.player = '';
	demo.action = demo.replayMatch;
	demo.refresh();
	$('#pause_btn').attr('disabled', false);
	$('#perform_btn').attr('disabled', true);
	demo.clickNum = 0;
	$('#pause_btn').html('暂停');
	demo.progress();
});
$('#pause_btn').attr('disabled', true);
$('#pause_btn').click(function(){
	demo.clickNum++;
	if (demo.clickNum % 2 != 0)
	{
		demo.pause = true;
		demo.isOpen=false;
		clearInterval(demo.interval)
		$(this).html('开始');
		$('#perform_btn').attr('disabled', false);
	}
	else {
		$(this).html('暂停');
		demo.pause = false;
		//demo.isOpen = false;
		demo.player = '';
		demo.action = demo.replayMatch;
		demo.refresh();
		demo.isOpen = true;
		demo.progress();
		$('#perform_btn').attr('disabled', true);
	}
});
demo.init();

});
</script>
</head>
